public class RelationOp04 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
        int b = 15;
        a++; //11
        b--; //14
        int c = b % a; // c = 4 
        System.out.println(c >= b);
	}

}
